楽天ランキング　美容・コスメ・香水部門　リアルタイムランキング（2015年4月28日(木)11:57）1位！<BR><BR><font color="#FF0000"></font><br><font size="4" color="#FF0000">定形外郵便配送となります為、日時指定不可となります！<br><br><br><b>定形外郵便送料無料のため代金引換決済時は2個以上から送料無料でご購入いただけます。<br>1個ご購入で代金引換をお選びの場合は、「宅配便送料540円」が発生いたしますのでどうぞご了承願います。</b><br><br></font><table border="0" cellpadding="0" cellspacing="1px" bgcolor="#CCCCCC" width="500"><tr><td width="40%" style="background: #ECECEC; font-size: 12px; padding:10px;">商品名</td><td width="60%" style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>アルガニック ヘア トリートメント</p></td></tr><tr><td width="40%" style="background: #ECECEC; font-size: 12px; padding:10px;">内容量</td><td width="60%" style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>60ml</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">商品説明</td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>毎日のヘアケアでサラサラに♪洗い流さないトリートメント。モロッコの黄金と呼ばれる希少オイル。クレオパトラも愛用していたといわれるアルガンオイル配合！<br>パサパサ ギシギシ まとまらない つやがない 枝毛 切れ毛 ダメージヘア ストレスヘア 美髪 ストレートヘア 潤い<br>髪に優しい♪ 独自ブレンドされたオイル。女性に嬉しい♪　もちろん、男性にも嬉しい♪アルガンオイルと15種類の植物エキス配合</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">使用方法</td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>１.【タオルドライをする】<br>シャンプー、リンス後に、タオルなどで髪の水分を十分にドライします。水気はゴシゴシ拭き取らず、優しく押さえて吸い取るイメージで♪<br>２.【ムラなく馴染ます】<br>数滴のオイルを手のひらに伸ばし、毛先を中心に全体へ、しっかりムラなく馴染ませます。<br>３.【ドライヤーで乾かす】<br>ドライヤーで髪全体を乾かしたらお手入れ終了です。高温の風邪を長時間髪にあてず、ドライヤーはなるべく離して使いましょう。</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">成分</td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>シクロペンタシロキサン、ジメチコン、アルガニアスピノサ核油、オリーブ油、ツバキ種子油、マカデミアナッツ油、メドウファーム油、コメ胚芽油、ヘーゼルナッツ油、シア脂、ホホバ種子油、ブドウ種子油、アーモンド油、月見草油、ローズヒップ油、アボカド油、パーシック油、ピスタチオ種子油、トコフェロール、香料</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">広告文責</td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>株式会社エーキューブアソシエーション (06-4705-7573)</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">メーカー/発売元<br></td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>シンエイ</p></td></tr><tr><td style="background: #ECECEC; font-size: 12px; padding:10px;">原産国/区分</td><td style="background: #FFFFFF; font-size: 12px; padding:10px;"><p>日本製/化粧品</p></td></tr></table><style type="text/css">
